{'action': 'created', 'issue': {'url': 'https://api.github.com/repos/bytecodealliance/wasmtime/issues/3936', 'repository_url': 'https://api.github.com/repos/bytecodealliance/wasmtime', 'labels_url': 'https://api.github.com/repos/bytecodealliance/wasmtime/issues/3936/labels{/name}', 'comments_url': 'https://api.github.com/repos/bytecodealliance/wasmtime/issues/3936/comments', 'events_url': 'https://api.github.com/repos/bytecodealliance/wasmtime/issues/3936/events', 'html_url': 'https://github.com/bytecodealliance/wasmtime/issues/3936', 'id': 1171366803, 'node_id': 'I_kwDOBhDaXM5F0aOT', 'number': 3936, 'title': 'In wasmtime CLI, passing --tcplisten argument breaks --dir', 'user': {'login': 'SteveSandersonMS', 'id': 1101362, 'node_id': 'MDQ6VXNlcjExMDEzNjI=', 'avatar_url': 'https://avatars.githubusercontent.com/u/1101362?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/SteveSandersonMS', 'html_url': 'https://github.com/SteveSandersonMS', 'followers_url': 'https://api.github.com/users/SteveSandersonMS/followers', 'following_url': 'https://api.github.com/users/SteveSandersonMS/following{/other_user}', 'gists_url': 'https://api.github.com/users/SteveSandersonMS/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/SteveSandersonMS/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/SteveSandersonMS/subscriptions', 'organizations_url': 'https://api.github.com/users/SteveSandersonMS/orgs', 'repos_url': 'https://api.github.com/users/SteveSandersonMS/repos', 'events_url': 'https://api.github.com/users/SteveSandersonMS/events{/privacy}', 'received_events_url': 'https://api.github.com/users/SteveSandersonMS/received_events', 'type': 'User', 'site_admin': False}, 'labels': [{'id': 678995594, 'node_id': 'MDU6TGFiZWw2Nzg5OTU1OTQ=', 'url': 'https://api.github.com/repos/bytecodealliance/wasmtime/labels/bug', 'name': 'bug', 'color': 'bb0000', 'default': True, 'description': 'Incorrect behavior in the current implementation that needs fixing'}], 'state': 'open', 'locked': False, 'assignee': None, 'assignees': [], 'milestone': None, 'comments': 18, 'created_at': '2022-03-16T18:04:58Z', 'updated_at': '2022-04-19T09:04:41Z', 'closed_at': None, 'author_association': 'NONE', 'active_lock_reason': None, 'body': '### Test Case

[testcase.zip](https://github.com/bytecodealliance/wasmtime/files/8267462/testcase.zip)

### Steps to Reproduce

1. Extract `main.wasm` from the test case zip file. Or compile it yourself using WASI SDK and the following source code, e.g. via `~/wasi-sdk/bin/clang main.c --sysroot ~/wasi-sdk/share/wasi-sysroot -o main.wasm` if you have WASI SDK at `~/wasi-sdk`.

```c
#include <stdio.h>
#include <sys/types.h>
#include <dirent.h>

int main (void) {
  DIR *dp = opendir ("./");
  struct dirent *ep;

  if (dp != NULL) {
    while ((ep = readdir (dp)))
      printf("%s\n", ep->d_name);
    closedir(dp);
  }
  else
    printf("Couldn't open the directory\n");

  return 0;
}
```

2. Run `wasmtime main.wasm --dir=.` and observe it print a directory listing
3. Run `wasmtime main.wasm --dir=. --tcplisten=127.0.0.1:9000` and observe it fail to do so (it will print *Couldn't open the directory*)

### Expected Results

I expect that `--tcplisten` should *not* break the directory mapping.

### Actual Results

Passing `--tcplisten` makes it behave as if you didn't pass `--dir=.`.

### Versions and Environment

Wasmtime version or commit: 0.35.1

Operating system: linux

Architecture: x86_64

### Extra Info

Other than this, `--tcplisten` works brilliantly and I've been able to implement a nontrivial web server application using this flag and the new `sock_accept` API.', 'reactions': {'url': 'https://api.github.com/repos/bytecodealliance/wasmtime/issues/3936/reactions', 'total_count': 0, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'timeline_url': 'https://api.github.com/repos/bytecodealliance/wasmtime/issues/3936/timeline', 'performed_via_github_app': None}, 'comment': {'url': 'https://api.github.com/repos/bytecodealliance/wasmtime/issues/comments/1102346018', 'html_url': 'https://github.com/bytecodealliance/wasmtime/issues/3936#issuecomment-1102346018', 'issue_url': 'https://api.github.com/repos/bytecodealliance/wasmtime/issues/3936', 'id': 1102346018, 'node_id': 'IC_kwDOBhDaXM5BtHci', 'user': {'login': 'sdeleuze', 'id': 141109, 'node_id': 'MDQ6VXNlcjE0MTEwOQ==', 'avatar_url': 'https://avatars.githubusercontent.com/u/141109?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/sdeleuze', 'html_url': 'https://github.com/sdeleuze', 'followers_url': 'https://api.github.com/users/sdeleuze/followers', 'following_url': 'https://api.github.com/users/sdeleuze/following{/other_user}', 'gists_url': 'https://api.github.com/users/sdeleuze/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/sdeleuze/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/sdeleuze/subscriptions', 'organizations_url': 'https://api.github.com/users/sdeleuze/orgs', 'repos_url': 'https://api.github.com/users/sdeleuze/repos', 'events_url': 'https://api.github.com/users/sdeleuze/events{/privacy}', 'received_events_url': 'https://api.github.com/users/sdeleuze/received_events', 'type': 'User', 'site_admin': False}, 'created_at': '2022-04-19T09:04:41Z', 'updated_at': '2022-04-19T09:04:41Z', 'author_association': 'NONE', 'body': 'Hi, thanks for raising this since I hit the same problem when implementing a web server that serve static files. I am wondering if there is a consensus on how to fix it? Could be the case based on this discussion above but I am not 100% sure.

@bjorn3 said:
> According to man sd_listen_fds the first socket must be at fd 3 (so preopened directories must be after the preopened sockets, not before)

Then @haraldh said:
> A combination of fd_prestat_get() for the directories and fd_fdstat_get() checking fs_filetype == SocketStream could be used without extending the WASI spec.

So is it correct to assume that it is possible to fix this issue without extending the WASI spec, in a compliant way with man sd_listen_fds (preopened directories must be after the preopened sockets) just by refining how Wasmtime handles this?

Happy to try crafting a PR with proper guidance.', 'reactions': {'url': 'https://api.github.com/repos/bytecodealliance/wasmtime/issues/comments/1102346018/reactions', 'total_count': 0, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'performed_via_github_app': None}}

