ing-native/milestone/32', 'labels_url': 'https://api.github.com/repos/spring-projects-experimental/spring-native/milestones/32/labels', 'id': 7803097, 'node_id': 'MI_kwDODFGdAs4AdxDZ', 'number': 32, 'title': '0.12.0', 'description': 'Spring Boot 2.7 baseline', 'creator': {'login': 'sdeleuze', 'id': 141109, 'node_id': 'MDQ6VXNlcjE0MTEwOQ==', 'avatar_url': 'https://avatars.githubusercontent.com/u/141109?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/sdeleuze', 'html_url': 'https://github.com/sdeleuze', 'followers_url': 'https://api.github.com/users/sdeleuze/followers', 'following_url': 'https://api.github.com/users/sdeleuze/following{/other_user}', 'gists_url': 'https://api.github.com/users/sdeleuze/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/sdeleuze/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/sdeleuze/subscriptions', 'organizations_url': 'https://api.github.com/users/sdeleuze/orgs', 'repos_url': 'https://api.github.com/users/sdeleuze/repos', 'events_url': 'https://api.github.com/users/sdeleuze/events{/privacy}', 'received_events_url': 'https://api.github.com/users/sdeleuze/received_events', 'type': 'User', 'site_admin': False}, 'open_issues': 11, 'closed_issues': 7, 'state': 'open', 'created_at': '2022-03-25T09:58:44Z', 'updated_at': '2022-04-19T08:06:51Z', 'due_on': '2022-05-20T07:00:00Z', 'closed_at': None}, 'comments': 14, 'created_at': '2021-01-29T23:21:20Z', 'updated_at': '2022-04-19T08:07:53Z', 'closed_at': '2022-04-19T08:06:51Z', 'author_association': 'CONTRIBUTOR', 'active_lock_reason': None, 'body': "In Spring Batch, there are two custom scopes `StepScope` and `JobScope`. In each of these scenarios, the bean's definition is proxied so that the underlying bean can be created later during execution. This functionality allows for things like the ability to inject job parameters into Spring Batch components.

However, the proxies being created when using a native image are based on the return type of a method defined with the `@Bean` annotation. If I have a class that implements multiple interfaces that must be exposed via the poxy, there is no way currently to generate that.

An example of the issue can be found here: https://github.com/mminella/spring-graalvm-native/tree/batch_io. In that example, in the `BatchConfiguration` class, there is a bean defined as:

```java 
@StepScope
@Bean
public ItemReaderListener reader() {
   ...
}
```

`ItemReaderListener` is a class that implements the `ItemReader`, `ItemStream`, and the `StepExecutionListener` interfaces. Spring Batch provides a composite interface for `ItemReader` and `ItemStream` so the method can be refactored to return `ItemStreamReader`. However, the proxy created based on that definition cannot be cast to a `StepExecutionListener`.
