{'action': 'created', 'issue': {'url': 'https://api.github.com/repos/spring-projects-experimental/spring-native/issues/459', 'repository_url': 'https://api.github.com/repos/spring-projects-experimental/spring-native', 'labels_url': 'https://api.github.com/repos/spring-projects-experimental/spring-native/issues/459/labels{/name}', 'comments_url': 'https://api.github.com/repos/spring-projects-experimental/spring-native/issues/459/comments', 'events_url': 'https://api.github.com/repos/spring-projects-experimental/spring-native/issues/459/events', 'html_url': 'https://github.com/spring-projects-experimental/spring-native/issues/459', 'id': 797267585, 'node_id': 'MDU6SXNzdWU3OTcyNjc1ODU=', 'number': 459, 'title': 'Unable to generate proxy for class that implements multiple interfaces.', 'user': {'login': 'mminella', 'id': 630743, 'node_id': 'MDQ6VXNlcjYzMDc0Mw==', 'avatar_url': 'https://avatars.githubusercontent.com/u/630743?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/mminella', 'html_url': 'https://github.com/mminella', 'followers_url': 'https://api.github.com/users/mminella/followers', 'following_url': 'https://api.github.com/users/mminella/following{/other_user}', 'gists_url': 'https://api.github.com/users/mminella/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/mminella/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/mminella/subscriptions', 'organizations_url': 'https://api.github.com/users/mminella/orgs', 'repos_url': 'https://api.github.com/users/mminella/repos', 'events_url': 'https://api.github.com/users/mminella/events{/privacy}', 'received_events_url': 'https://api.github.com/users/mminella/received_events', 'type': 'User', 'site_admin': False}, 'labels': [], 'state': 'open', 'locked': False, 'assignee': None, 'assignees': [], 'milestone': {'url': 'https://api.github.com/repos/spring-projects-experimental/spring-native/milestones/11', 'html_url': 'https://github.com/spring-projects-experimental/spring-native/milestone/11', 'labels_url': 'https://api.github.com/repos/spring-projects-experimental/spring-native/milestones/11/labels', 'id': 5828699, 'node_id': 'MDk6TWlsZXN0b25lNTgyODY5OQ==', 'number': 11, 'title': 'Backlog', 'description': 'Issues to be evaluated before native support for Spring Boot applications reaches General Availability', 'creator': {'login': 'sdeleuze', 'id': 141109, 'node_id': 'MDQ6VXNlcjE0MTEwOQ==', 'avatar_url': 'https://avatars.githubusercontent.com/u/141109?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/sdeleuze', 'html_url': 'https://github.com/sdeleuze', 'followers_url': 'https://api.github.com/users/sdeleuze/followers', 'following_url': 'https://api.github.com/users/sdeleuze/following{/other_user}', 'gists_url': 'https://api.github.com/users/sdeleuze/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/sdeleuze/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/sdeleuze/subscriptions', 'organizations_url': 'https://api.github.com/users/sdeleuze/orgs', 'repos_url': 'https://api.github.com/users/sdeleuze/repos', 'events_url': 'https://api.github.com/users/sdeleuze/events{/privacy}', 'received_events_url': 'https://api.github.com/users/sdeleuze/received_events', 'type': 'User', 'site_admin': False}, 'open_issues': 63, 'closed_issues': 0, 'state': 'open', 'created_at': '2020-08-31T17:09:21Z', 'updated_at': '2022-03-23T07:15:19Z', 'due_on': None, 'closed_at': None}, 'comments': 11, 'created_at': '2021-01-29T23:21:20Z', 'updated_at': '2022-04-05T06:35:46Z', 'closed_at': None, 'author_association': 'CONTRIBUTOR', 'active_lock_reason': None, 'body': "In Spring Batch, there are two custom scopes `StepScope` and `JobScope`. In each of these scenarios, the bean's definition is proxied so that the underlying bean can be created later during execution. This functionality allows for things like the ability to inject job parameters into Spring Batch components.

However, the proxies being created when using a native image are based on the return type of a method defined with the `@Bean` annotation. If I have a class that implements multiple interfaces that must be exposed via the poxy, there is no way currently to generate that.

An example of the issue can be found here: https://github.com/mminella/spring-graalvm-native/tree/batch_io. In that example, in the `BatchConfiguration` class, there is a bean defined as:

```java 
@StepScope
@Bean
public ItemReaderListener reader() {
   ...
}
```

`ItemReaderListener` is a class that implements the `ItemReader`, `ItemStream`, and the `StepExecutionListener` interfaces. Spring Batch provides a composite interface for `ItemReader` and `ItemStream` so the method can be refactored to return `ItemStreamReader`. However, the proxy created based on that definition cannot be cast to a `StepExecutionListener`.
