@Component
class NameUppercaser(private val validator: Validator) : Consumer<String> {
    override fun accept(inputS: String) {

        val mapper = jacksonObjectMapper().registerModule(JavaTimeModule()).enable(DeserializationFeature.ACCEPT_SINGLE_VALUE_AS_ARRAY)
