        }
    }
}

data class SNSEvent(
    @JsonProperty("Records")
    val records: List<Record>,
)

data class Record(
    @JsonProperty("Sns")
    val sns: SNS,
)

data class SNS(
    @JsonProperty("Message")
    val message: String,
)

data class Message(
    @JsonProperty("data")
    @get:Valid
    val data: TestEventData
    )


data class TestEventData(
    @get:Pattern(regexp = "[0-9a-f]{1,100}")
    @JsonProperty("eventId")
