alse, 'description': "An issue we've not yet triaged or decided on"}], 'state': 'open', 'locked': False, 'assignee': None, 'assignees': [], 'milestone': None, 'comments': 1, 'created_at': '2022-03-24T06:28:47Z', 'updated_at': '2022-03-25T07:27:20Z', 'closed_at': None, 'author_association': 'NONE', 'active_lock_reason': None, 'body': 'Hi, the org.springframework.session.servlet.HttpSessionHints hint has classes that exist in spring security packages such as WebAuthenticationDetails, DefaultSavedRequest and etc.

```
@NativeHint(trigger = SpringHttpSessionConfiguration.class,
        imports = CommonSessionSerializables.class,
        serializables = {@SerializationHint(types = {
                TreeMap.class,
                Locale.class,
                DefaultSavedRequest.class,
                DefaultCsrfToken.class,
                WebAuthenticationDetails.class,
                SavedCookie.class

        }, typeNames = {
                "java.lang.String$CaseInsensitiveComparator",
        })
        }, abortIfTypesMissing = true)
public class HttpSessionHints implements NativeConfiguration {
    @Override
    public boolean isValid(AotOptions aotOptions) {
        return ClassUtils.isPresent("javax.servlet.http.HttpSession", null);
    }
}

```

The session hints and the security hits should not be messed up as one cannot use spring session without spring security with spring-native. They should be separated.', 'reactions': {'url': 'https://api.github.com/repos/spring-projects-experimental/spring-native/issues/1539/reactions', 'total_count': 0, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'timeline_url': 'https://api.github.com/repos/spring-projects-experimental/spring-native/issues/1539/timeline', 'performed_via_github_app': None}, 'comment': {'url': 'https://api.github.com/repos/spring-projects-experimental/spring-native/issues/comments/1078733469', 'html_url': 'https://github.com/spring-projects-experimental/spring-native/issues/1539#issuecomment-1078733469', 'issue_url': 'https://api.github.com/repos/spring-projects-experimental/spring-native/issues/1539', 'id': 1078733469, 'node_id': 'IC_kwDODFGdAs5ATCqd', 'user': {'login': 'sdeleuze', 'id': 141109, 'node_id': 'MDQ6VXNlcjE0MTEwOQ==', 'avatar_url': 'https://avatars.githubusercontent.com/u/141109?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/sdeleuze', 'html_url': 'https://github.com/sdeleuze', 'followers_url': 'https://api.github.com/users/sdeleuze/followers', 'following_url': 'https://api.github.com/users/sdeleuze/following{/other_user}', 'gists_url': 'https://api.github.com/users/sdeleuze/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/sdeleuze/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/sdeleuze/subscriptions', 'organizations_url': 'https://api.github.com/users/sdeleuze/orgs', 'repos_url': 'https://api.github.com/users/sdeleuze/repos', 'events_url': 'https://api.github.com/users/sdeleuze/events{/privacy}', 'received_events_url': 'https://api.github.com/users/sdeleuze/received_events', 'type': 'User', 'site_admin': False}, 'created_at': '2022-03-25T07:27:19Z', 'updated_at': '2022-03-25T07:27:19Z', 'author_association': 'COLLABORATOR', 'body