 {'login': 'fhanik', 'id': 607429, 'node_id': 'MDQ6VXNlcjYwNzQyOQ==', 'avatar_url': 'https://avatars.githubusercontent.com/u/607429?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/fhanik', 'html_url': 'https://github.com/fhanik', 'followers_url': 'https://api.github.com/users/fhanik/followers', 'following_url': 'https://api.github.com/users/fhanik/following{/other_user}', 'gists_url': 'https://api.github.com/users/fhanik/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/fhanik/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/fhanik/subscriptions', 'organizations_url': 'https://api.github.com/users/fhanik/orgs', 'repos_url': 'https://api.github.com/users/fhanik/repos', 'events_url': 'https://api.github.com/users/fhanik/events{/privacy}', 'received_events_url': 'https://api.github.com/users/fhanik/received_events', 'type': 'User', 'site_admin': False}], 'milestone': {'url': 'https://api.github.com/repos/spring-projects-experimental/spring-native/milestones/31', 'html_url': 'https://github.com/spring-projects-experimental/spring-native/milestone/31', 'labels_url': 'https://api.github.com/repos/spring-projects-experimental/spring-native/milestones/31/labels', 'id': 7596588, 'node_id': 'MI_kwDODFGdAs4Ac-os', 'number': 31, 'title': '0.11.4', 'description': '', 'creator': {'login': 'sdeleuze', 'id': 141109, 'node_id': 'MDQ6VXNlcjE0MTEwOQ==', 'avatar_url': 'https://avatars.githubusercontent.com/u/141109?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/sdeleuze', 'html_url': 'https://github.com/sdeleuze', 'followers_url': 'https://api.github.com/users/sdeleuze/followers', 'following_url': 'https://api.github.com/users/sdeleuze/following{/other_user}', 'gists_url': 'https://api.github.com/users/sdeleuze/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/sdeleuze/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/sdeleuze/subscriptions', 'organizations_url': 'https://api.github.com/users/sdeleuze/orgs', 'repos_url': 'https://api.github.com/users/sdeleuze/repos', 'events_url': 'https://api.github.com/users/sdeleuze/events{/privacy}', 'received_events_url': 'https://api.github.com/users/sdeleuze/received_events', 'type': 'User', 'site_admin': False}, 'open_issues': 5, 'closed_issues': 8, 'state': 'open', 'created_at': '2022-01-21T11:09:48Z', 'updated_at': '2022-03-15T09:27:32Z', 'due_on': None, 'closed_at': None}, 'comments': 5, 'created_at': '2022-01-06T14:17:41Z', 'updated_at': '2022-03-18T16:30:47Z', 'closed_at': None, 'author_association': 'COLLABORATOR', 'active_lock_reason': None, 'body': '`tomcat-embed-programmatic` is an experimental Tomcat dependency designed to lower the memory footprint, but it seems possible to reach similar or even lower footprint with the default `tomcat-embed-core` with a refined native configuration and an additional substitution.

My analysis tends to show that unused protocols are the main source of inefficiency, and more generally optional features should probably be removed from default Tomcat native configuration. As a consequence, I propose to modify [`tomcat-reflection.json`](https://github.com/apache/tomcat/blob/d7c6e0e9fe13a28dcf9bf9f98a65a954de0e48f7/res/graal/tomcat-embed-core/native-image/tomcat-reflection.json) as following:
 - Move `DefaultServlet` entry to a new `tomcat-reflection-default-servlet.json` file
 - Move `Http11Nio2Protocol` entry to a new `tomcat-reflection-nio2.json` file
 - Move `Http11AprProtocol` & `AprEndpoint` entries to a new `tomcat-reflection-apr.json` file
 - Move `OpenSSLImplementation`, `SSLHostConfig`, `SSLHostConfigCertificate`, `OpenSSLConf`, `AbstractJsseEndpoint` entries to a new `tomcat-reflection-ssl.json` file
 - Add a `{ "name":"org.apache.coyote.AbstractProtocol", "methods" : [{"name": "setPort","parameterTypes":["int"] }] }` entry (mandatory and previously covered as a side effect by `Http11AprProtocol` entry)

Those optional feature could then be enabled by users on demand with `Args = -H:ReflectionConfigurationResources=/META-INF/native-image/org.apache.tomcat.embed/tomcat-embed-core/tomcat-reflection-nio2.json` for example in a `/META-INF/native-image/native-image.properties` file. This principle is already use for [`tomcat-jni.json`](https://github.com/apache/tomcat/blob/d7c6e0e9fe13a28dcf9bf9f98a65a954de0e48f7/res/graal/tomcat-embed-core/native-image/tomcat-jni.json) which is [not included by default](https://github.com/apache/tomcat/blob/d7c6e0e9fe13a28dcf9bf9f98a65a954de0e48f7/res/graal/tomcat-embed-core/native-image/native-image.properties#L16).

This will require on Spring side the following substitution because Tomcat [`ProtocolHandler`](https://github.com/apache/tomcat/blob/d7c6e0e9fe13a28dcf9bf9f98a65a954de0e48f7/java/org/apache/coyote/ProtocolHandler.java#L233-L256) completly defeats GraalVM static analysis:

```
@TargetClass(className = "org.apache.coyote.ProtocolHandler", onlyWith = { OnlyIfPresent.class })
final class Target_ProtocolHandler {

	@Substitute
	public static ProtocolHandler create(String protocol, boolean apr)
			throws ClassNotFoundException, InstantiationException, IllegalAccessException,
			IllegalArgumentException, InvocationTargetException, NoSuchMethodException, SecurityException {
		return new org.apache.coyote.http11.Http11NioProtocol();
	}
}
```

Notice that we can't move forward without a Tomcat update because [`--exclude-config` in `native-image.properties` is likely broken](https://github.com/oracle/graal/pull/3749#issuecomment-1006597569), see also [this NBT issue](https://github.com/graalvm/native-build-tools/issues/185).

Unrelated, but likely worth to fix, `org.apache.tomcat.util.threads.res.LocalStrings` should probably be removed from `tomcat-resource.json` since there is an error message saying it does not exists.

@fhanik Could you please provide your feedback on the proposed changes, and if it is possible to perform them on Tomcat 9 branch or if we will have to wait Tomcat 10.1?
