My function looks like this:
```
@Component
class NameUppercaser(private val validator: Validator) : Consumer<String> {
    override fun accept(inputS: String) {

        val mapper = jacksonObjectMapper().registerModule(JavaTimeModule()).enable(DeserializationFeature.ACCEPT_SINGLE_VALUE_AS_ARRAY)
            .disable(DeserializationFeature.FAIL_ON_UNKNOWN_PROPERTIES)

        val snsEvent = mapper.readValue<SNSEvent>(inputS)

        snsEvent.records.forEach { record ->
            val event = mapper.readValue<Message>(record.sns.message)
            val violations = validator.validate(event)
            println(violations) // == []



        }
    }
}

data class SNSEvent(
    @JsonProperty("Records")
    val records: List<Record>,
)

data class Record(
    @JsonProperty("Sns")
    val sns: SNS,
)

data class SNS(
    @JsonProperty("Message")
    val message: String,
)

data class Message(
    @JsonProperty("data")
    @get:Valid
    val data: TestEventData
    )


data class TestEventData(
    @get:Pattern(regexp = "[0-9a-f]{1,100}")
    @JsonProperty("eventId")
    val eventId: String,
)
```

